import React from 'react';

const MapComponent = () => {
  return (
    <div className="map">
      <iframe
        src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d13646.10432752176!2d76.50656425!3d31.233856799999998!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39054af92bfa319f%3A0xf357bfe53f3fcde!2sAnandpur%20Sahib%2C%20Punjab!5e0!3m2!1sen!2sin!4v1717697685435!5m2!1sen!2sin"
        // max-width="500"
        height="220"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
        title="Anandpur Sahib Map"
      ></iframe>
    </div>
  );
};

export default MapComponent;
